    false,nt"url": null,nt"notes": "WASTE_SEPTAGE_SITES_IDEM_IN is a point
    shapefile that contains septage waste site locations in Indiana, provided by personnel
    of Indiana Department of Environmental Management, Office of Land Quality (IDEM,
    OLQ) as of July 11, 2003 and was subsequently updated on June 3, 2004, January 4,
    2005, April 25, 2005, July 27, 2006, January 24, 2007, June 4, 2009, October 20,
    2009, April 16, 2010, and June 25, 2013. The data set provided by IDEM was in an
    ESRI geodatabsae format and the feature class was named "SEPTAGE." WASTE_SEPTAGE_SITES_IDEM_IN
    is attributed with facility names and federal identification numbers. The following
    is excerpted from the metadata provided by IDEM, OLQ for the source shapefile SEPTAGE:
    "This dataset consists of Septage Sites - permitted septage (septic tank waste)
    sites where the waste is land applied, as defined by 327 IAC 7, 327 IAC 7-6, and
    327 IAC 7-7 of the Indiana Administrative Code."",nt"license_title": null,nt"extras":
